import styled from 'styled-components';

export const ContainerAll = styled.div`
	text-align: center;
	width: 100%;
	border: solid 2px black;
	padding: 12% 0;
`;

export const H1 = styled.h1`
	font-family: 'Heavy Data';
	color: white;
	text-align: left;
	margin: 0 5%;
	font-weight: bolder;
	font-size: 52px;
  width: 40%;
`;

export const Paragrafo = styled.p`color: white;`;
